    <div>
      <Link to="/home">
        <button>VIDEOGAMES</button>
      </Link>
    </div>
  );
};
<video>
  <source src='../../VID/mylivewallpapers.com-Ghost-of-Tsushima.mp4'></source>
</video>
export default LandingPage;
